sparql_query.8:
SELECT ?countryLabel
WHERE {
wd:Q47447 wdt:P27 ?country .
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],mul,en". }
}

sparql_query.11:
SELECT ?nationalityLabel
WHERE {
  wd:Q215215 wdt:P27 ?nationality .
  ?nationality rdfs:label ?nationalityLabel .
  FILTER(LANG(?nationalityLabel) = "en")
}

sparql_query.12:
SELECT ?locationLabel WHERE {
wd:Q12418 wdt:P131 ?location .
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],mul,en". }
}
